import Menu from './Menu.js';
import React, {lazy, } from 'react';
const HomePage = lazy(() => import('./components/HomePage.js'));
import { Link } from 'react-router-dom';
const Header = () => {
    return(
        <div id='header'>
            <button component={Link} to="/new/location/">
                Logo
            </button>
            <Menu />
        </div>
    )
}

export default Header;
